import React from "react";
import "./about-us.styles.scss";






const AboutUs=()=>{
    return(
        <div className="about-us-page">KNOW ABOUT US
        <div className="about-content">
            <div className="about-mission"></div>
            <div className="about-essence"></div>
            <div className="about-promise"></div>
            <div className="about-vibe"></div>
        </div>

        </div>
    )
}


 export default AboutUs;
